import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search.png'));

    // Click on the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_clicked_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_clicked_search.png'));

    // Wait for the wishlist link and click it
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });
    await page.click('a:has-text("Your Wish List")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_navigated_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_navigated_to_wishlist.png'));

    // Verify that we are on the wishlist page
    const wishlistHeader = await page.waitForSelector('h2:has-text("Your Wish List")', { timeout: 5000 });
    const headerText = await wishlistHeader.innerText();

    return {
      success: true,
      action: "Navigated to the wishlist page after adding a product to the wishlist",
      extractedData: { header: headerText },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
